import React, { Component } from 'react';
import Players from './components/players';

class Game extends Component {
    render() {
        return (
            <div>
                <h1>{this.props.username}</h1>
                <h2>{this.props.partyCode}</h2>
                <Players allPlayers={this.props.players}/>
            </div>
        );
    }
}
 
export default Game;
